import axios from 'axios';
import {
    LOGIN_USER,
    REGISTER_USER,
    AUTH_USER,
    LOGOUT_USER,
} from './types';

import { SERVER_URL } from '../config';

export const registerUser = async (dataToSubmit) => {
    try {
        const responseData = await axios.post(`${SERVER_URL}/register`, dataToSubmit);
        console.log(responseData);

        return {
            type: REGISTER_USER,
            payload: responseData
        }

    } catch (err) {
        console.log(err);
    }

}
